import { MainPage, CityForecastPage, CityWeatherPage } from "../pages";

export const routes = [
  { path: "/", component: MainPage, exact: true },
  { path: "/city/forecast/:id", component: CityForecastPage, exact: true },
  { path: "/city/weather/:id", component: CityWeatherPage, exact: true },
];
